import React from "react";
const News = ({title,image,description}) => {
    return(
        <div className="container text-light">
            <div className="cards pt-4">
                <h3>{title}</h3>
                <img src={image} alt="" />
                <p>{description}</p>
            </div>
        </div>
    );
}

export default News;
